let myAge = 10;
// We change the variable
myAge = 20; We can mutate (change) myAge as many times as we would like, since JavaScript allows mutable variables. When we try to do the same in Haskell: myAge :: Int
myAge = 10
myAge = 20 -- This is not allowed `myAge` can only be defined once, and we cannot change it

