Pure means doing one thing, and one thing only, example: 1 + 1, the + function is pure, it adds two numbers together and does nothing else. In common programming languages we can can mix pure and impure functions together: Example JavaScript: function addImpure(number1, number2) { let day = new Date().getDay(); console.log("Todays Day Is: ", day); return number1 + number2;
}
// The `addImpure` function is not pure, it will add two numbers together, but also print todays Day to the console. function addPure(number1, number2) { return number1 + number2;
}
// The `addPure` function is pure, it will add two numbers together and do nothing else. Haskell is purely functional, you cannot have impure functions such as: -- We create a function `addImpure` that receives `number1` which is of type `Int`, a `number2` also `Int` type, and then returns a value that is also `Int` type.
addImpure :: Int -> Int -> Int
addImpure number1 number2 = print "Hello" -- We cannot do this, the compiler will fail with an error number1 + number2 We can only create pure functions: -- We create a Pure Function named `addPure`
addPure :: Int -> Int -> Int
addPure number1 number2 = number1 + number2

